window.bookSummaryJSON = "<p>Grace has a job she loves, a community she adores, and plenty of friends . . . but her lack of bedroom action has left this event planner too horny to think.</p> <p>When one ill-advised night at the bar leads to her giving an exhibitionistic show to an unknown presence outside her bedroom window, she thinks she's hit a new low. When her voyeur turns out to be a nebbishly charming mothman, Grace needs to decide if she can trust her body—and her heart—with this garnet-eyed stranger before he flies out of her life for good.</p> <p>Contains mature themes.</p>"; 
